import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './login.css';

const Login = () => {
  const [email, setEmail] = useState('admin@l3bty.com');
  const [password, setPassword] = useState('123456');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  const handleLogin = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    try {
      console.log('üì§ ÿ•ÿ±ÿ≥ÿßŸÑ ÿ∑ŸÑÿ® ÿ™ÿ≥ÿ¨ŸäŸÑ ÿØÿÆŸàŸÑ...');
      
      const response = await fetch('http://localhost:5000/api/auth/login', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ 
          email: email.trim(),
          password: password 
        })
      });
      
      console.log('üì• ÿ≠ÿßŸÑÿ© ÿßŸÑÿßÿ≥ÿ™ÿ¨ÿßÿ®ÿ©:', response.status);
      
      const data = await response.json();
      console.log('üìä ÿ®ŸäÿßŸÜÿßÿ™ ÿßŸÑÿßÿ≥ÿ™ÿ¨ÿßÿ®ÿ©:', data);
      
      if (!response.ok) {
        throw new Error(data.message || 'ŸÅÿ¥ŸÑ ÿ™ÿ≥ÿ¨ŸäŸÑ ÿßŸÑÿØÿÆŸàŸÑ');
      }
      
      if (data.success && data.token && data.user) {
        // ÿ≠ŸÅÿ∏ ÿßŸÑÿ®ŸäÿßŸÜÿßÿ™
        localStorage.setItem('token', data.token);
        localStorage.setItem('user', JSON.stringify(data.user));
        
        console.log('üíæ ÿ™ŸÖ ÿ≠ŸÅÿ∏ ÿßŸÑÿ™ŸàŸÉŸÜ ŸàÿßŸÑŸÖÿ≥ÿ™ÿÆÿØŸÖ');
        console.log('üë§ ÿ®ŸäÿßŸÜÿßÿ™ ÿßŸÑŸÖÿ≥ÿ™ÿÆÿØŸÖ:', data.user);
        console.log('üé≠ ÿØŸàÿ± ÿßŸÑŸÖÿ≥ÿ™ÿÆÿØŸÖ:', data.user.role);
        
        // ÿ•ÿπÿßÿØÿ© ÿßŸÑÿ™Ÿàÿ¨ŸäŸá ÿ≠ÿ≥ÿ® ÿßŸÑÿØŸàÿ±
        setTimeout(() => {
          if (data.user.role === 'admin') {
            console.log('üöÄ ÿßŸÑÿ™Ÿàÿ¨ŸäŸá ÿ•ŸÑŸâ Admin Dashboard');
            navigate('/admin/dashboard');
          } else if (data.user.role === 'branch_manager' || data.user.role === 'employee') {
            console.log('üöÄ ÿßŸÑÿ™Ÿàÿ¨ŸäŸá ÿ•ŸÑŸâ Employee Dashboard');
            navigate('/employee/dashboard');
          } else {
            console.log('üöÄ ÿßŸÑÿ™Ÿàÿ¨ŸäŸá ÿ•ŸÑŸâ Rental Page');
            navigate('/rental');
          }
        }, 100);
        
      } else {
        throw new Error('ÿ®ŸäÿßŸÜÿßÿ™ ÿßŸÑÿßÿ≥ÿ™ÿ¨ÿßÿ®ÿ© ÿ∫Ÿäÿ± ŸÉÿßŸÖŸÑÿ©');
      }
      
    } catch (err) {
      console.error('üî• ÿÆÿ∑ÿ£ ŸÅŸä ÿ™ÿ≥ÿ¨ŸäŸÑ ÿßŸÑÿØÿÆŸàŸÑ:', err);
      setError(err.message || 'ÿ≠ÿØÿ´ ÿÆÿ∑ÿ£ ŸÅŸä ÿßŸÑÿßÿ™ÿµÿßŸÑ ÿ®ÿßŸÑÿÆÿßÿØŸÖ');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="login-container">
      <div className="login-box">
        <h2>ÿ≥ÿ¨ŸÑ ÿØÿÆŸàŸÑŸÉ ŸÑŸÑŸàÿµŸàŸÑ ŸÑŸÑŸÜÿ∏ÿßŸÖ</h2>
        
        {error && <div className="error-message">{error}</div>}
        
        <form onSubmit={handleLogin}>
          <div className="form-group">
            <label>ÿßŸÑÿ®ÿ±ŸäÿØ ÿßŸÑÿ•ŸÑŸÉÿ™ÿ±ŸàŸÜŸä</label>
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
              placeholder="ÿ£ÿØÿÆŸÑ ÿßŸÑÿ®ÿ±ŸäÿØ ÿßŸÑÿ•ŸÑŸÉÿ™ÿ±ŸàŸÜŸä"
              disabled={loading}
            />
          </div>
          
          <div className="form-group">
            <label>ŸÉŸÑŸÖÿ© ÿßŸÑŸÖÿ±Ÿàÿ±</label>
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
              placeholder="ÿ£ÿØÿÆŸÑ ŸÉŸÑŸÖÿ© ÿßŸÑŸÖÿ±Ÿàÿ±"
              disabled={loading}
            />
          </div>
          
          <button type="submit" disabled={loading}>
            {loading ? 'ÿ¨ÿßÿ±Ÿä ÿ™ÿ≥ÿ¨ŸäŸÑ ÿßŸÑÿØÿÆŸàŸÑ...' : 'ÿ™ÿ≥ÿ¨ŸäŸÑ ÿßŸÑÿØÿÆŸàŸÑ'}
          </button>
        </form>
        
        <div className="test-credentials">
          <h4>ÿ®ŸäÿßŸÜÿßÿ™ ÿßÿÆÿ™ÿ®ÿßÿ±:</h4>
          <p><strong>Admin:</strong> admin@l3bty.com / 123456</p>
          <p><strong>Manager:</strong> manager@gazimall.com / 123456</p>
          <p><strong>Employee:</strong> emp1@gazimall.com / 123456</p>
        </div>
      </div>
    </div>
  );
};

export default Login;
